    false,nt"url": null,nt"notes": "The Oregon Department of Geology & Mineral
    Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
    topographic LiDAR data for multiple areas within the state of Oregon. The areas
    for LiDAR collection have been designed as part of a collaborative effort of state,
    federal, and local agencies in order to meet a wide range of project goals. This
    LiDAR data set was collected in 11 delivery areas from October 23, 2008 through
    August 9, 2009. See below for the specific date of collection and total area covered
    for each delivery. This data set covers 1553 square miles (994,440 square acres)
    and falls in portions of the following counties in northwestern Oregon: Clatsop,
    Columbia, Lane, Lincoln, Tillamook, and Washington. This data set consists of bare
    earth and unclassified points. The average pulse density is 8.61 points per square
    meter over terrestrial surfaces. In some areas of heavy vegetation or forest cover,
    there may be relatively few ground points in the LiDAR data. Elevation values for
    open water surfaces are not valid elevation values because few LiDAR points are
    returned from water surfaces. LiDAR intensity values were also collected. This LiDAR
    data set was collected on different dates and organized into 11 deliveries. To determine
    which delivery or deliveries are in your area of interest, download the Delivery
    Area graphic at: ftp://ftp.csc.noaa.gov/pub/crs/beachmap/qa_docs/or/north_coast/2009_dogami_oregon_lidar_north_coast.jpg
    The specific date of collection and total area covered for each delivery are listed
    below. Delivery 1: Acquisition Date: 20090405-20090510 Total Area = 96,383 sq acres
    Delivery 2: Acquisition Date: 20090416-20090615 Total Area = 115,458 sq acres Delivery
    3: Acquisition Date: 20081023-20090615 Total Area = 78,033 sq acres Delivery 4:
    Acquisition Date: 20081025-20081116 Total Area = 53,279 sq acres Delivery 5: Acquisition
    Date: 20090426-20090628 Total Area = 74,477 sq acres Delivery 6: Acquisition Date:
    20090531-20090623 Total Area = 101,056 sq acres Delivery 7: Acquisition Date: 20090531-20090628
    Total Area = 99,438 sq acres Delivery 8: Acquisition Date: 20090520-20090616 Total
    Area = 71,734 sq acres Delivery 9: Acquisition Date: 20090421-20090716 Total Area
    = 101,033 sq acres Delivery 10: Acquisition Date: 20090710-20090719 Total Area =
    133,920 sq acres Delivery 11: Acquisition Date: 20090714-20090809 Total Area = 69,629
